import React from "react";
const Foot = () =>{
    const logo = "https://exarta.com/wp-content/uploads/2022/09/logo-2.svg";
    return(
        <div className="w-full bg-[#FF7A00]  md: px-4">
            <div className="max-w-[1240px] grid lg:grid-cols-2 ">
                <div><img src={logo} /></div>
            <div > <h1>hhh</h1></div>
              
            </div>
            
        </div>
    )
}
export default Foot;
